import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { useParams, useNavigate } from 'react-router-dom';
import { AgGridReact } from 'ag-grid-react';
import { ClientSideRowModelModule } from '@ag-grid-community/client-side-row-model';
import 'ag-grid-community/styles/ag-grid.css';
import 'ag-grid-community/styles/ag-theme-alpine.css';
// import './TicketResponse.css';

const TicketResponse = () => {
  const { ticketId } = useParams();
  const navigate = useNavigate();

  // Ticket & Message
  const [ticket, setTicket] = useState(null);
  const [messages, setMessages] = useState([]);
  const [newMessage, setNewMessage] = useState('');

  // Form
  const [description, setDescription] = useState('');
  const [categoryId, setCategoryId] = useState('');
  const [priorityId, setPriorityId] = useState('');
  const [categories, setCategories] = useState([]);
  const [priorities, setPriorities] = useState([]);

  // Grid
  const [tickets, setTickets] = useState([]);
  const [columnDefs, setColumnDefs] = useState([
    { headerName: "ID", field: "id" },
    { headerName: "Açıklama", field: "description" },
    { headerName: "Kategori", field: "categoryName" },
    { headerName: "Öncelik", field: "priorityName" },
  ]);

  // Ticket detaylarını ve mesajları al
  useEffect(() => {
    const fetchData = async () => {
      try {
        const token = localStorage.getItem('token');
        const headers = { Authorization: `Bearer ${token}` };

        const ticketRes = await axios.get(`http://localhost:5094/api/ticket/${ticketId}`, { headers });
        setTicket(ticketRes.data);

        const messagesRes = await axios.get(`http://localhost:5094/api/ticket/${ticketId}/messages`, { headers });
        setMessages(messagesRes.data);

        const ticketsRes = await axios.get(`http://localhost:5094/api/ticket`, { headers });
        setTickets(ticketsRes.data);

        const categoryRes = await axios.get(`http://localhost:5094/api/category`, { headers });
        setCategories(categoryRes.data);

        const priorityRes = await axios.get(`http://localhost:5094/api/priority`, { headers });
        setPriorities(priorityRes.data);

      } catch (error) {
        console.error('Veriler alınamadı:', error);
      }
    };

    fetchData();
  }, [ticketId]);

  // Yeni mesaj gönder
  const handleSendMessage = async () => {
    if (!newMessage.trim()) return;

    try {
      const token = localStorage.getItem('token');
      const res = await axios.post(`http://localhost:5094/api/ticket/${ticketId}/messages`, {
        content: newMessage
      }, {
        headers: { Authorization: `Bearer ${token}` }
      });

      setMessages(prev => [...prev, res.data]);
      setNewMessage('');
    } catch (error) {
      console.error('Mesaj gönderilemedi:', error);
    }
  };

  // Form gönderme işlemi
  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      const token = localStorage.getItem('token');
      await axios.post('http://localhost:5094/api/ticket', {
        description,
        categoryId,
        priorityId
      }, {
        headers: { Authorization: `Bearer ${token}` }
      });

      setDescription('');
      setCategoryId('');
      setPriorityId('');

      // Listeyi güncelle
      const res = await axios.get(`http://localhost:5094/api/ticket`, {
        headers: { Authorization: `Bearer ${token}` }
      });
      setTickets(res.data);

    } catch (error) {
      console.error('Talep gönderilemedi:', error);
    }
  };

  if (!ticket) return <div>Yükleniyor...</div>;

  return (
    <div className="container">
        <div className="sidebar right">
        <div className="logo">HelpDesk</div>
        <ul className="nav">
          <li><span className="icon">🎫</span> <span className="label">Tickets</span></li>
          <li><span className="icon">👥</span> <span className="label">Agents</span></li>
          <li><span className="icon">⚙️</span> <span className="label">Settings</span></li>
        </ul>
        <div className="profile">
          <img src="https://i.pravatar.cc/40" alt="user" />
          <span>User</span>
        </div>
      </div>
      <div>
        <div className="ticket-grid ag-theme-alpine">
          <h3>Mevcut Talepler</h3>
          <AgGridReact
            rowData={tickets}
            modules={[ClientSideRowModelModule]}
            onRowDoubleClicked={(event) => navigate(`/ticket/${event.data.id}`)}
            columnDefs={columnDefs}
            domLayout="autoHeight"
            pagination={true}
            paginationPageSize={5}
          />
        </div>
      </div>


    </div>
  );
};

export default TicketResponse;
